	 public static int lengthOfLongestSubstring(String s) {
		 
		 List<String> aList=new ArrayList<String>();
		 int len=0;
		 for(int i=0;i<s.length();i++) {
			 
			 String aChar = s.substring(i, i+1);
			 int ind = aList.indexOf(aChar);
			 if(ind!=-1) {
				 
				 if(len<aList.size()) {
					 len=aList.size();
				 }
				 if(ind==aList.size()-1) {
					 aList=new ArrayList<String>();
				 } else {
					 aList = new ArrayList<String>(aList.subList(ind+1, aList.size()));
				 }
			 }
			 
			 aList.add(aChar);
		 }
		 
		 if(len<aList.size()) {
			 len=aList.size();
		 }
		 
		 return len;
	 }

